import Layout from '../components/Layout';
import { useRouter } from 'next/router';

const Single = () =>  {

   const router = useRouter(); 

   const { title } = router.query;

   return  (
    <Layout>
        <div>

            <h1>{title}</h1>
            <p>This is dynamic page with query strings.</p>
        
        </div>
    </Layout>

    );
};


export default Single;
